import React, {Component} from "react";

class Tasks extends Component{
    render(){
        return(
            this.props.tasks.map( e =>
            <div>
              <p key={e.id}>{e.id} - {e.titulo} - {String(e.done)}</p>
              <input type="checkbox"/>
              <button>
                  Button
              </button>
            </div> 
            )
        )
    }
    
}

export default Tasks;
